    [],nt"num_tags": 27,nt"name": "erie-national-wildlife-refuge-annual-narrative-report-fiscal-year-1974",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Erie National
    Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal year. The
    report begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, mammals, raptors, fish, and reptiles- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, and vegetation control. Resource management is outlined; topics include
    grazing, haying, and fur harvesting. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, and hunting.",nt"owner_org":
